ADXL343 accel;

void show_prediction(int cls)
{
    int r = LOW, g = LOW, b = LOW;

    switch (cls)
    {
    case 0:
        r = HIGH;
        g = LOW;
        b = LOW;
        break;
    case 1:
        r = LOW;
        g = HIGH;
        b = LOW;
        break;
    case 2:
        r = LOW;
        g = LOW;
        b = HIGH;
        break;
    case 3:
        r = LOW;
        g = LOW;
        b = LOW;
        break;
    }

    digitalWrite(D2, g);
    digitalWrite(D3, r);
    digitalWrite(D4, b);
}

Timer samplingTimer(2, []
                    {
    if (samplingIndex < SAMPLE_COUNT) {
        float x, y, z;
        accel.readAccelerationG(&x, &y, &z);

        samplingBuffer[samplingIndex].x = x;
        samplingBuffer[samplingIndex].y = y;
        samplingBuffer[samplingIndex].z = z;

        samplingIndex++;

        if (samplingIndex >= SAMPLE_COUNT)
            bufferReady = true;
    } });

void setup()
{
    Serial.begin(115200);

    delay(1000);
    Serial.println("Model C starting...");

    pinMode(D2, OUTPUT);
    pinMode(D3, OUTPUT);
    pinMode(D4, OUTPUT);

#if TEST_MODE

    samplingTimer.stop();

    processingBuffer = samplingBuffer;

    load_test_data();

    for (int i = 0; i < SAMPLE_COUNT; i++)
    {
        samplingBuffer[i].x = TEST_AX[i];
        samplingBuffer[i].y = TEST_AY[i];
        samplingBuffer[i].z = TEST_AZ[i];
    }

    bufferReady = true;

#else
    // Live accelerometer mode
    if (!accel.begin())
    {
        Serial.println("ADXL343 init failed");
        System.reset();
    }
    samplingTimer.start();
#endif
}

void loop()
{
#if TEST_MODE
    static bool once = true;
    if (!once)
        return;
    once = false;
#endif

    if (!bufferReady)
        return;

    float features_f[FEATURE_COUNT];
    extract_features(processingBuffer, features_f);

    int16_t features_i[FEATURE_COUNT];
    for (int i = 0; i < FEATURE_COUNT; i++)
        features_i[i] = (int16_t)(features_f[i] * 1.0f);

    int pred = rf_kick_model_predict(features_i, FEATURE_COUNT);

    Serial.printf("Prediction: %d\n", pred);

    Serial.println("FEATURES_F:");
    for (int i = 0; i < FEATURE_COUNT; i++)
    {
        Serial.printf("%.4f ", features_f[i]);
    }
    Serial.println();

    Serial.println("FEATURES_I:");
    for (int i = 0; i < FEATURE_COUNT; i++)
    {
        Serial.printf("%d ", features_i[i]);
    }
    Serial.println();

    show_prediction(pred);

#if !TEST_MODE
    // Buffer swap i live mode
    Sample *tmp = samplingBuffer;
    samplingBuffer = processingBuffer;
    processingBuffer = tmp;

    samplingIndex = 0;
    bufferReady = false;
#endif
}
